    }

    public function load(ObjectManager $manager): void
    {
        $output = new ConsoleOutput();
        $output->write('Load region and departments ... ');
        $regionDatas = $this->getRegionsFR();
        $dptDatas = $this->getDepartmentsFR();
        ksort($regionDatas);
        $dpts = [];

        foreach ($regionDatas as $regionData) {
            $region = new Region();
            $region->setName($regionData['name']);
            $region->setMapPaths($regionData['mapPaths']);
            $manager->persist($region);
            ksort($regionData['departmentCodes']);

            foreach ($regionData['departmentCodes'] as $code) {
                $dptData = $dptDatas[$code];
                $dpt = new Department();
                $dpt->setCode($code);
                $dpt->setName($dptData['name']);
                $dpt->setMapPaths($dptData['mapPaths']);
                $dpt->setRegion($region);
                $manager->persist($dpt);
                $dpts[$code] = $dpt;
            }
        }
        $manager->flush();
        $output->writeln('<info>done</info>');

        $output->writeln('Load cities ... ');
        $finder = new Finder();
        $filesFound = $finder->in(array($this->publicDir . '/files'))->name('laposte_hexasmal.csv')->files();
        $row = 1;

        if (count($filesFound) == 1) {
            foreach ($filesFound as $file) {
                $apcSetted = [];
                $indexes = [
                    'name' => 1,
                    'postCode' => 2,
                    'name2' => 3,
                    'coordinates' => 5,
                ];


                if (($handle = fopen($file->getRealPath(), "r")) !== FALSE) {
                    $file = new \SplFileObject($file->getRealPath(), 'r');
                    $file->seek(PHP_INT_MAX);
                    $progressBar = new ProgressBar($output, $file->key() + 1);

                    while (($data = fgetcsv($handle, 1000, ";")) !== FALSE) {
                        if ($row == 1) {
                            $row++;
                            continue;
                        } //Break the first line  
                        $progressBar->advance();

                        $name = $data[$indexes['name2']] ? $data[$indexes['name2']] : $data[$indexes['name']];
                        $postCode = str_pad($data[$indexes['postCode']], 5, "0", STR_PAD_LEFT);
                        $dptCode = substr($postCode, 0, 2);
                        $coordinates = explode(",", $data[$indexes['coordinates']]);
                        $latitude = $coordinates[0] ? floatval($coordinates[0]) : null;
                        $longitude = isset($coordinates[1]) && $coordinates[1] ? floatval($coordinates[1]) : null;

                        //Process cities with arrondissement only once
                        $arrondissementPostCodes = [
                            ['match' => '#^MARSEILLE \d+$#', 'name' => 'MARSEILLE', 'postCode' => '13000'],
                            ['match' => '#^LYON \d+$#', 'name' => 'LYON', 'postCode' => '69000'],
                            ['match' => '#^PARIS \d+$#', 'name' => 'PARIS', 'postCode' => '75000'],
                        ];
                        foreach ($arrondissementPostCodes as $apc) {
                            if (preg_match($apc['match'], $name)) {
                                if (isset($apcSetted[$apc['match']])) {
                                    continue 2;
                                } else {
                                    $apcSetted[$apc['match']] = 1;
                                    $name = $apc['name'];
                                    $postCode = $apc['postCode'];
                                }
                            }
                        }

                        $city = new City();
                        $city->setName($name);
                        $city->setPostCode($postCode);
                        $city->setLatitude($latitude);
                        $city->setLongitude($longitude);

                        if (isset($dpts[$dptCode])) {
                            $city->setDepartment($dpts[$dptCode]);
                        }
                        $manager->persist($city);
                        $row++;
                    }
                    $manager->flush();
                    $progressBar->finish();
                }
            }
        }

        $output->writeln("\n");
    }

